import React from 'react'
import style from './index.module.scss'
import youla from 'assets/icon/jieji/youla.png'
import clock from 'assets/icon/jieji/clock.png'
import dot_two from 'assets/icon/jieji/dot_two.png'
import dot_one from 'assets/icon/jieji/dot_one.png'
export default function index(props) {
  const toDetail = (item) => {
    console.log(item);
  }
  return (
    <div>
      <div  >
        {
          props.order_list.map((item) => {
            return (
              <div className={style.order_content} onClick={() => toDetail(item)} key={item.order_id}>
                <div className={style.order_type}>{item.type}</div>
                <div className={style.order_status}>
                  {item.status}
                  <img className={style.icon_youla} src={youla}></img>
                </div>
                <div className={style.date_time}>
                  <img className={style.icon_clock} src={clock}></img>
                  {item.time}
                </div>
                <img className={`${style.dot} ${dot_one}`} src={dot_one}></img>
                <div className={style.order_from}>
                  {item.add_from}
                </div>
                <img className={`${style.dot} ${dot_two}`} src={dot_two}></img>
                <div className={style.order_to}>
                  {item.add_to}
                </div>
                <div className={style.order_price}>
                  AU${item.price}
                </div>
              </div>
            )
          })
        }
      </div>
    </div>
  )
}
